import React from "react";
import "./App.css";
function App() {
  const [data, setData] = React.useState([]);
  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => {

        setData(data)
      });
  } 
  , []);
  return (
    <div className="App">
      <br/><br/><br/>
      {data.map(d => 
        <div className="box">
          <div> </div>{d.name}
          </div>
        )}
    </div>
  );
}
export default App;
